import { StatusBar } from 'expo-status-bar'
import React, { useEffect, useState } from 'react'
import { SafeAreaView, View, Platform, Image } from 'react-native'

const Frame = ({ height = 260, width = 400, cols = 4, rows = 3 }) => {
  const frameWidth = width / cols,
    frameHeight = height / cols
  return (
    <View style={{}}>
      <View
        style={{ overflow: 'hidden', width: frameWidth, height: frameHeight }}
      >
        <Image
          style={{ height, width, position: 'absolute' }}
          source={require('./assets/bunny-hop-spritesheet-1.png')}
        />
      </View>
    </View>
  )
}

export default function App() {
  return (
    <SafeAreaView
      style={{
        flex: 1,
        backgroundColor: '#f00',
        paddingTop: Platform.OS === 'android' ? 30 : 0,
      }}
    >
      <Frame />
    </SafeAreaView>
  )
}
